(22, 'Orientation & Goal Setting\nThis module introduces learners to the course structure and helps them define personal objectives.\nTopics include navigating the learning platform, understanding expectations, and setting SMART goals. Participants will leave with a clear roadmap to stay motivated and aligned with course outcomes.', NULL, NULL, 'Orientation & Goal Setting', 9, ''),
(23, 'This module serves as the gateway to the course, providing learners with a clear understanding of what to expect and how to succeed.\nParticipants will explore the course objectives, key topics, and structure, ensuring they are well-prepared to engage with the material. The module also introduces essential tools, resources, and communication channels to support their learning journey.\nBy the end, learners will have a solid foundation, a sense of direction, and the confidence to dive into the course content.\n', NULL, NULL, 'Introduction', 9, ''),
(24, 'This module lays the groundwork for the course by introducing the core concepts, principles, and terminology essential for understanding the subject matter.\nLearners will explore the building blocks of the topic, gaining a solid foundation to build upon in later modules. Through engaging content, practical examples, and interactive activities, participants will develop a clear understanding of the basics and be prepared to tackle more advanced material with confidence.', NULL, NULL, 'Fundamentals', 9, ''),
(25, 'Following the Fundamentals, this module delves deeper into the key ideas and theories that form the backbone of the course.\nLearners will explore intermediate-level topics, practical applications, and case studies to connect theory with real-world scenarios. By the end of this module, participants will have a stronger grasp of the subject and be ready to apply their knowledge in more complex contexts.', NULL, NULL, 'Core Concepts', 9, ''),
(35, 'Java is an object-oriented programming language.\n\nEverything in Java is associated with classes and objects, along with its attributes and methods. For example: in real life, a car is an object. The car has attributes, such as weight and color, and methods, such as drive and brake.\n\nA Class is like an object constructor, or a \"blueprint\" for creating objects.', NULL, NULL, 'Classes and Objects', 9, 'https://www.w3schools.com/java/java_classes.asp');

